import React from 'react';
import AppLayout from '../components/AppLayout.js';

const Home = () => {
    return (//AppLayout 사이에 있는것이 children으로 전달됨
        <AppLayout>
            <div>Hello, Next!</div>
            <div>Today is Sunday</div>
        </AppLayout>   
    );
}

export default Home;
